import React from 'react';

const leaders = [
  {
    name: "John Smith",
    role: "CEO",
    image: "https://images.unsplash.com/photo-1560250097-0b93528c311a?auto=format&fit=crop&w=200&h=200"
  },
  {
    name: "Sarah Johnson",
    role: "CTO",
    image: "https://images.unsplash.com/photo-1573496359142-b8d87734a5a2?auto=format&fit=crop&w=200&h=200"
  },
  {
    name: "Michael Chen",
    role: "COO",
    image: "https://images.unsplash.com/photo-1472099645785-5658abf4ff4e?auto=format&fit=crop&w=200&h=200"
  },
  {
    name: "Emily Brown",
    role: "CFO",
    image: "https://images.unsplash.com/photo-1580489944761-15a19d654956?auto=format&fit=crop&w=200&h=200"
  },
  {
    name: "David Wilson",
    role: "CIO",
    image: "https://images.unsplash.com/photo-1519085360753-af0119f7cbe7?auto=format&fit=crop&w=200&h=200"
  }
];

const regions = ["Bengaluru", "Tamil Nadu", "Andhra Pradesh", "Telangana", "Delhi"];

const Leadership = () => {
  return (
    <div className="container mx-auto px-4">
      <div className="text-center mb-12">
        <h2 className="text-4xl font-bold mb-4">Our Leadership</h2>
        <p className="text-gray-600 max-w-2xl mx-auto">
          Meet our experienced leadership team driving innovation and excellence.
        </p>
      </div>

      <div className="grid grid-cols-2 md:grid-cols-5 gap-8 mb-20">
        {leaders.map((leader, index) => (
          <div key={index} className="text-center">
            <div className="mb-4">
              <img
                src={leader.image}
                alt={leader.name}
                className="w-32 h-32 rounded-full mx-auto object-cover"
              />
            </div>
            <h3 className="font-semibold">{leader.name}</h3>
            <p className="text-gray-600">{leader.role}</p>
          </div>
        ))}
      </div>

      <div className="text-center mb-12">
        <h2 className="text-4xl font-bold mb-4">Regional Presence</h2>
        <p className="text-gray-600 max-w-2xl mx-auto mb-8">
          Our strategic locations across India enable us to serve clients effectively.
        </p>
        <div className="flex justify-center items-center space-x-4 mb-8">
          {regions.map((region, index) => (
            <React.Fragment key={region}>
              <span className="text-blue-600">{region}</span>
              {index < regions.length - 1 && (
                <span className="w-2 h-2 rounded-full bg-blue-600"></span>
              )}
            </React.Fragment>
          ))}
        </div>
      </div>

      {/* Google Maps iframe */}
      <div className="aspect-video w-full mb-8">
        <iframe
          src="https://www.google.com/maps/embed?pb=!1m18!1m12!1m3!1d497699.9973874144!2d77.35074421903454!3d12.95384772557775!2m3!1f0!2f0!3f0!3m2!1i1024!2i768!4f13.1!3m3!1m2!1s0x3bae1670c9b44e6d%3A0xf8dfc3e8517e4fe0!2sBengaluru%2C%20Karnataka!5e0!3m2!1sen!2sin!4v1645451087254!5m2!1sen!2sin"
          width="100%"
          height="100%"
          style={{ border: 0 }}
          allowFullScreen
          loading="lazy"
        ></iframe>
      </div>

      <div className="text-center">
        <a
          href="#contact"
          className="bg-blue-600 text-white px-8 py-3 rounded-lg hover:bg-blue-700 transition-colors inline-block"
        >
          Find Us Near You
        </a>
      </div>
    </div>
  );
};

export default Leadership;
